var images = [
  "data:image/bmp;base64,",

  //   change this url
  "assets/images/bg.jpg",
];

function LoadImagesAndRender() {
  var loadedImages = 0;
  for (var i = 0; i < images.length; i++) {
    var source = images[i];
    images[i] = new Image();
    images[i].src = source;
    images[i].onload = function () {
      loadedImages++;
      if (loadedImages == images.length) {
        Render();
      }
    };
  }
}

function Render() {
  let a = document.getElementById("bgCanvas");
  let b = a.getContext("2d");

  var mainHeight = document.querySelector("main").clientHeight;

  a.width = 782;
  a.height = mainHeight;

  b.drawImage(images[0], 0, 0, 782, mainHeight);

  b.globalCompositeOperation = "source-in";

  b.drawImage(images[1], 0, 0, 782, mainHeight);

  b.globalCompositeOperation = "source-over";
}

window.onload = LoadImagesAndRender;
window.addEventListener("resize", Render);

// countdown

var countDownDate = new Date("Feb 21, 2024").getTime();

var x = setInterval(function () {
  var now = new Date().getTime();
  var distance = countDownDate - now;
  var weeks = Math.floor((distance % (1000 * 60 * 60 * 24)) / (1000 * 60 * 7));
  var days = Math.floor(distance / (1000 * 60 * 60 * 24));
  var hours = Math.floor((distance % (1000 * 60 * 60 * 24)) / (1000 * 60 * 60));
  var minutes = Math.floor((distance % (1000 * 60 * 60)) / (1000 * 60));
  var seconds = Math.floor((distance % (1000 * 60)) / 1000);

  $("#days").text(days);
  $("#hours").text(hours);
  $("#minutes").text(minutes);
  $("#seconds").text(seconds);

  if (distance < 0) {
    clearInterval(x);
    $("#days").text("0");
    $("#hours").text("0");
    $("#minutes").text("0");
    $("#seconds").text("0");
  }
}, 1000);
